export const AboutUsLegend = () => {
  return (
    <>
      <div className="legend-layout">
          <picture>
              <source media="(max-width: 991px)" srcset="./img/aboutus/removebg-m.png"></source>
              <img src="./img/aboutus/removebg-l.png" alt=""></img>
          </picture>
      </div>
    </>
  );
};
